import React from "react";
// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";
// import InputLabel from "@material-ui/core/InputLabel";
// core components
import GridItem from "components/Grid/GridItem.jsx";
import GridContainer from "components/Grid/GridContainer.jsx";
// import CustomInput from "components/CustomInput/CustomInput.jsx";
import Button from "components/CustomButtons/Button.jsx";
import Card from "components/Card/Card.jsx";
import CardHeader from "components/Card/CardHeader.jsx";
import CardAvatar from "components/Card/CardAvatar.jsx";
import CardBody from "components/Card/CardBody.jsx";
import CardFooter from "components/Card/CardFooter.jsx";

import avatar from "assets/img/faces/marc.jpg";

const styles = {
  cardCategoryWhite: {
    color: "rgba(255,255,255,.62)",
    margin: "0",
    fontSize: "14px",
    marginTop: "0",
    marginBottom: "0"
  },
  cardTitleWhite: {
    color: "#FFFFFF",
    marginTop: "0px",
    minHeight: "auto",
    fontWeight: "300",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    marginBottom: "3px",
    textDecoration: "none"
  }
};

class AddExpense extends React.Component {
  // constructor(props){
  //   super(props);
  //   this.state = {   
  //        expense : ''
  //   };
    // this.handleOnChangeE = this.handleOnChangeE.bind(this);
    // this.handleOnSubmit = this.handleOnSubmit.bind(this);
  // } 
  state = {

    expense : ''
  }

  // componentDidMount(){


  //   axios.get('http://192.168.43.46:8080/rest/get-day-expense').then(dataList => this.setState({dataList : dataList.data},()=> console.log(dataList)) );
  // }
  handleOnChangeE = (e)=>{

    this.setState({expense : e.target.value});


}
//   handleOnSubmit(e){
//     e.preventDefault();
//     var send = {dataList2 : this.state.dataList2};
//     console.log('hello')
//     console.log(send.dataList2)

//     // Axios.post('http://localhost:5000/at/recieveit',{send}).then(console.log('Message sent '));
//  }

  render(){

    const { classes } = this.props;
    return (
      <div>
        <form  >
        <GridContainer>
          <GridItem xs={12} sm={12} md={8}>
            <Card>
              <CardHeader color="primary">
                <h4 className={classes.cardTitleWhite}>Expense Details</h4>
                <p className={classes.cardCategoryWhite}>Complete your expense details</p>
              </CardHeader>
              <CardBody>
                <GridContainer>
                  {/* <GridItem xs={12} sm={12} md={10}>
                    <CustomInput
                      labelText="Company (disabled)"
                      id="company-disabled"
                      formControlProps={{
                        fullWidth: true
                      }}
                      inputProps={{
                        disabled: true
                      }}
                    />
                  </GridItem> */}
                  <GridItem xs={12} sm={12} md={3}>
                  <div class="form-group">

                  <input type="text" class="form-control"  id="food" placeholder="Food" disabled/>
                </div>     
                  </GridItem>


                  <GridItem xs={12} sm={12} md={3}>
                  <div class="form-group">
              {/*  */}
                  <input type="text" class="form-control" onChange= {this.handleOnChangeE} id="expense1" placeholder="Expense" />
                </div>
                  </GridItem>


                  <GridItem xs={12} sm={12} md={3}>
                  <div class="form-group">
              {/*  */}
                  <input type="text" class="form-control" id="mode1" placeholder="Mode Of Payment"/>
                </div>
                  </GridItem>
                </GridContainer>




                <GridContainer>
                <GridItem xs={12} sm={12} md={3}>
                <div class="form-group">
              {/*  */}
                  <input type="text" class="form-control"  id="groceries" placeholder="Groceries" disabled/>
                </div>
                  </GridItem>
                  <GridItem xs={12} sm={12} md={3}>
                  <div class="form-group">
              {/*  */}
                  <input type="text" class="form-control" id="expense2" placeholder="Expense"/>
                </div>
                  </GridItem>
                  <GridItem xs={12} sm={12} md={3}>
                  <div class="form-group">

